import React from "react";
import star from "../assets/star.png";

const Rating = ({ rating }) => {
  rating = Math.round(rating);
  return (
    <div className="flex gap-2 items-center">
      {Array.from({ length: rating }).map((_, i) => (
        <img src={star} alt="Star" key={i} />
      ))}
    </div>
  );
};

export default Rating;
